      /* (391) decl_var_attrs_list ::= decl_var_attr (OPTIMIZED OUT) */ assert(yyruleno!=391);
      /* (392) decl_var_attrs_list ::= decl_var_attrs_list decl_var_attr */ yytestcase(yyruleno==392);
      /* (393) decl_var_attrs_optional ::= */ yytestcase(yyruleno==393);
      /* (394) decl_var_attrs_optional ::= decl_var_attrs_list */ yytestcase(yyruleno==394);
      /* (395) decl_func ::= func_decl (OPTIMIZED OUT) */ assert(yyruleno!=395);
      /* (396) stmt_brace ::= stmt (OPTIMIZED OUT) */ assert(yyruleno!=396);
      /* (397) stmt_expr ::= expr2stmt (OPTIMIZED OUT) */ assert(yyruleno!=397);
      /* (398) stmts_brace ::= stmt_brace (OPTIMIZED OUT) */ assert(yyruleno!=398);
      /* (399) stmts_brace ::= stmts_expr SCOLON_SPACE stmt_brace */ yytestcase(yyruleno==399);
      /* (400) stmts_brace ::= stmts_brace SPACE stmt_brace */ yytestcase(yyruleno==400);
      /* (401) stmts_expr ::= stmt_expr (OPTIMIZED OUT) */ assert(yyruleno!=401);
      /* (402) stmts_expr ::= stmts_expr SCOLON_SPACE stmt_expr */ yytestcase(yyruleno==402);
      /* (403) stmts_expr ::= stmts_brace SPACE stmt_expr */ yytestcase(yyruleno==403);
      /* (404) stmts_optional ::= rcbrace_or_space (OPTIMIZED OUT) */ assert(yyruleno!=404);
      /* (405) stmts_optional ::= SPACE stmts_brace rcbrace_or_space */ yytestcase(yyruleno==405);
      /* (406) stmts_optional ::= SPACE stmts_expr rcbrace_or_scolon */ yytestcase(yyruleno==406);
      /* (407) decl_struct_attrs_list ::= decl_struct_attr (OPTIMIZED OUT) */ assert(yyruleno!=407);
      /* (408) decl_struct_attrs_list ::= decl_struct_attrs_list decl_struct_attr */ yytestcase(yyruleno==408);
      /* (409) decl_struct ::= struct_decl_begin lparen_or_space RPAREN decl_struct_attrs_optional decl_struct_close_or_at */ yytestcase(yyruleno==409);
      /* (410) decl_struct ::= struct_decl_begin lparen_or_space struct_fvars rparen_or_comma decl_struct_attrs_optional decl_struct_close_or_at */ yytestcase(yyruleno==410);
      /* (411) decl_enum ::= enum_decl_begin lparen_or_space RPAREN enum_base_begin enum_base_end decl_enum_close_or_at */ yytestcase(yyruleno==411);
      /* (412) decl_enum ::= enum_decl_begin lparen_or_space enum_cvars rparen_or_comma enum_base_begin enum_base_end decl_enum_close_or_at */ yytestcase(yyruleno==412);
      /* (413) decl_gvar_list ::= decl_gvar (OPTIMIZED OUT) */ assert(yyruleno!=413);
      /* (414) decl_gvar_list ::= decl_gvar_list decl_gvar */ yytestcase(yyruleno==414);
      /* (415) decl_gvars ::= LCBRACE_GVAR SPACE_RCBRACE */ yytestcase(yyruleno==415);
      /* (416) decl_gvars ::= LCBRACE_GVAR SPACE decl_gvar_list rcbrace_or_comma */ yytestcase(yyruleno==416);
